import React from 'react';
import pic from '../assets/flying_fox.png'


const About = () => {
    return(
        <div className='max-w-7xl mx-auto h-auto py-24'>
            <div className="flex flex-row items-center justify-between">
                <img src={pic} alt="" className='h-80' />
                <div className="flex-col items-center justify-center text-center font-potta-one text-8xl font-normal leading-none text-[#f9f5e3]">About Us
                    <div className="w-44">
                        <p className='text-sm font-space-mono '>HackTrent is the premier hackathon event hosted by Trent University. Join us for an exciting weekend of innovation, collaboration, and creativity. HackTrent offers an inclusive and inspiring environment to bring your ideas to life. Register now and be a part of the HackTrent experience!</p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default About;
